function() {
    this.origGetListSize = this.getListSize;
    this.getListSize = function(m) {
        if (m['mode'] == 'organic-thumbnails-a')
            return 2;
        return this.origGetListSize(m);
    }
    TRC.aspect.before(this, 'handleLoadResponse', function(cacheKey, response, isCache) {
        try {
            if (!TRC.variant && response.trc.td) {
                TRC.variant = response.trc.td;
                TRC.variantLaunched = 0;
            }
        } catch (e) {
            __trcError(e);
        }
    }, true);
    //Function to add 'Sponsored / ' before branding
		//Called from item-renderer hook
		/***** START - define-sponsored-position-hook *****/
		try {
			TRC.appendSponsoredBeforeBranding = function(box, data) {
				try {
					var branding = box.querySelector('.branding');
					var sponsoredSpan = document.createElement('span');
					var brandingSpan = document.createElement('span');
					if (!!branding) {
						sponsoredSpan.innerHTML = 'SPONSORED';
						sponsoredSpan.classList.add('sponsoredSpan');
						brandingSpan.innerHTML = ' / ' + data['branding-text'];
						brandingSpan.classList.add('brandingSpan');
						branding.innerHTML = '';
						branding.appendChild(sponsoredSpan);
						branding.appendChild(brandingSpan);
					}
				} catch (e) {
					__trcError('Error in publisher-start appendSponsoredBeforeBranding : ', e.message);
				}
			}
		} catch (e) {
			__trcError('Error in publisher-start define-sponsored-position-hook : ', e.message)
		}
		/***** END - define-sponsored-position-hook *****/
    //Function to add category , logo and video lebel + play icon to video items
    //Called from item-renderer hook
    TRC.appendCategoryAndVideoLabel = function(box, data) {
        try {
            var thumbBlockHolder = box.querySelector('.thumbBlock_holder'),
                itemType = data.type,
                url = data.url,
                splitedUrl = url.split('/'),
                externalData = data['external-data'],
                description = box.querySelector('.video-label.video-description'),
                videoLabelBox = box.querySelector('.video-label-box.trc-main-label'),
                logoHolder = document.createElement('span'),
                title = box.querySelector('.video-label.video-title'),
                exchangeSlot = box.querySelector('.inNetworkItem');
            //if there's no description (ie. AE), create the span
            if(description === null) {
                description = document.createElement('span');
                description.classList.add('video-label', 'video-description', 'trc_ellipsis', 'blueCategory');
                videoLabelBox.insertBefore(description, title);
            }
            logoHolder.classList.add('logoHolder');
            videoLabelBox.insertBefore(logoHolder, description);
            //Checking if the item type is video & not exchange
            if (itemType == 'video' && exchangeSlot != null) {
                //building video label and icon
                var label = document.createElement('div'),
                    labelText = document.createElement('div'),
                    videoLabel = document.createElement('div'),
                    playIcon = document.createElement('div');
                label.classList.add('itemLabel');
                labelText.classList.add('itemLebelText');
                videoLabel.classList.add('videoLabel');
                playIcon.classList.add('playIcon');
                //Displays video duration via data.uploader.
                //Since this is a change from the old code, if the metadata needs recrawling, then it'll default to displaying VDIDEO
                //As of 06 Feb 2019, NBC page meta started returning durations with seconds, so these durations need truncating
                if (data['uploader'] && data['uploader'].split(':').length == 3) {
                    try {
                        data['uploader'] = data['uploader'].slice(0, -3)
                    } catch (e) {
                        __trcError(e);                    }
                }
                labelText.innerHTML = data['uploader'].length > 0 ? data['uploader'] : 'VIDEO';
                // console.log('The duration is ' + data['uploader'])
            }
            //checking if the item type is video
            var checkVideo = function(classColor) {
                try {
                    if (itemType == 'video' && exchangeSlot != null) {
                        //Matching video icon color by category
                        videoLabel.classList.add(classColor);
                        //Appending play icon to video items
                        videoLabel.appendChild(playIcon);
                        thumbBlockHolder.appendChild(videoLabel);
                        label.appendChild(labelText);
                        thumbBlockHolder.appendChild(label);
                    }
                } catch (e) {
                    __trcError(e);
                }
            }
            //==============================================================================//
            //Adding 'think' var and category
            var better, mach, news, think;
            //Checking if the category exists
            if (typeof externalData != 'undefined') {
                better = 'BETTER / ' + externalData;
                mach = 'MACH / ' + externalData;
                news = 'NBC NEWS / ' + externalData;
                think = 'THINK / ' + externalData;
            } else {
                better = 'BETTER';
                mach = 'MACH';
                news = 'NBC NEWS';
                think = 'THINK';
            }
            //Matching color and logo to category
            if (box.closest('.inNetworkItem')) {
                description.innerHTML = 'NBC NEWS / SHOP';
                logoHolder.classList.add('nbcLogo');
            } else {
                switch (splitedUrl[3]) {
                    case 'today':
                        description.classList.add('redCategory');
                        logoHolder.classList.add('todayLogo');
                        checkVideo('redCategory');
                        break;
                    case 'better':
                        description.innerHTML = better;
                        description.classList.add('blueCategory');
                        logoHolder.classList.add('nbcLogo');
                        checkVideo('blueCategory');
                        break;
                    case 'mach':
                        description.innerHTML = mach;
                        description.classList.add('blueCategory');
                        logoHolder.classList.add('nbcLogo');
                        checkVideo('blueCategory');
                        break;
                    case 'msnbc':
                        description.classList.add('blueCategory');
                        logoHolder.classList.add('msnbcLogo');
                        checkVideo('blueCategory');
                        break;
                    case 'think':
                        description.innerHTML = think;
                        description.classList.add('redCategory');
                        logoHolder.classList.add('thinkLogo');
                        checkVideo('redCategory');
                        break;
                    default:
                        description.innerHTML = news;
                        description.classList.add('blueCategory');
                        logoHolder.classList.add('nbcLogo');
                        checkVideo('blueCategory');
                }
            }
        } catch (e) {
            __trcError(e);
        }
    }
    /***** START - [publisher-start remove-social-buttons-malay] *****/
    if (document.location.href.indexOf('huawei-malaysia') > -1 ){
        setTimeout(function(){
            try {
                // get width size of the phone
                var widthWindow = document.body.clientWidth;
                // if width is bigger the 480px could means we are on tablets and desktop break
                if (widthWindow > 768) throw null;
                // remove dropdown button
                document.getElementsByClassName('share-ex h-h h-w js-share-toggle')[0].remove();
            } catch(error){
                __trcError('Error in publisher-start remove-social-buttons-malay ' + error.message);
            }
        }, 2000);
    }
    /***** END - [publisher-start remove-social-buttons-malay] *****/
}
